  return (


    <BrowserRouter>
    <Navbar />
      <Routes>
      <Route path="/home" element={<Home />} />
      <Route path="/about" element={<About />} />
      <Route path="/achive" element={<About />} />
      <Route path="/about" element={<About />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
